@app.route('/login', methods=['GET','POST'])
def login():
    if "login" in session:
        return "<script>location.href = 'home'</script>"
    else:
        if request.method =='POST':
            id = request.form['id']
            pw = request.form['pww']
            f = open("id.txt", 'r')
            data = f.read()
            f.close()
            data = ast.literal_eval("{"+data+"}")
            try:
                a = 0;
                for x in range(11):
                    a = a + 1
                    if sha3_256((sha3_256(pw.encode()).hexdigest()+str(a)).encode()).hexdigest() == data[id]:
                        break
                if a <= 10: 
                    session["login"] = id
                    return "<script>location.href = 'home'</script>"
                else:
                    return render_template('login.html', wrong=1)
            except KeyError:
                return render_template('login.html', wrong=0)
        else:
            return render_template('login.html', wrong=-1)

    
@app.route('/signup', methods=['GET','POST'])
def signup():
    if "login" in session:
        return "<script>location.href = 'home'</script>"
    else:
        if request.method =='POST':
            id = request.form['id']
            if len(id) < 21:
                pw = request.form['pww']
                f = open("id.txt", 'r')
                data = f.read()
                f.close()
                datas = ast.literal_eval("{"+data+"}")
                try:
                    datas[id]
                    return render_template('signup.html', wrong=0)
                except KeyError:
                    datas[id] = sha3_256((sha3_256(pw.encode()).hexdigest()+str(random.randrange(1,11))).encode()).hexdigest()
                    f = open("id.txt",'w')
                    f.write(str(datas)[1:-1])
                    f.close()
                    session["login"] = id
                    f = open("profile.txt", 'r')
                    data = f.read()
                    f.close()
                    datas = ast.literal_eval("{"+data+"}")
                    datas[id] = ["#b","#b"]
                    f = open("profile.txt",'w')
                    f.write(str(datas)[1:-1])
                    f.close()
                    f = open("mail.txt", 'r')
                    data = f.read()
                    f.close()
                    datas = ast.literal_eval("{"+data+"}")
                    datas[id] = []
                    f = open("mail.txt",'w')
                    f.write(str(datas)[1:-1])
                    f.close()
                    f = open("chat.txt", 'r')
                    data = f.read()
                    f.close()
                    datas = ast.literal_eval("{"+data+"}")
                    datas[id] = []
                    f = open("chat.txt",'w')
                    f.write(str(datas)[1:-1])
                    f.close()
                    return "<script>location.href = 'login'</script>"
            else:
                return render_template('signup.html', wrong=0)
        else:
            return render_template('signup.html', wrong=-1)

