@app.route('/chat/<name>', methods=['GET','POST'])
def chat(name):
    if "login" in session:
        if request.method =='POST':
            f = open("chats.txt", 'r')
            chats = f.read()
            f.close()
            chats = ast.literal_eval("{"+chats+"}")
            
            if session["login"] in chats[name][1] or chats[name][0][0]=='1':
                
                f = open("chatt.txt", 'r')
                aas = f.read()
                f.close()
                aas = ast.literal_eval("{"+aas+"}")
                current_datetime = datetime.datetime.now()
                three_hours_delta = datetime.timedelta(hours=3)
                result_datetime = current_datetime - three_hours_delta
                result_datetime = result_datetime.replace(microsecond=0)
                aas[name].append(session['login'])
                aas[name].append(request.form['ttext'])
                aas[name].append(str(result_datetime))

                aas = str(aas)[1:-1]
                f = open("chatt.txt",'w')
                f.write(aas)
                f.close()
                return "<script>location.href = ''</script>"
            
            else:
                return "<script>alert('You do not have access permission.');location.href = '../home'</script>"
            
        else:
            f = open("chats.txt", 'r')
            chats = f.read()
            f.close()
            chats = ast.literal_eval("{"+chats+"}")
            
            if session["login"] in chats[name][1] or chats[name][0][0]=='1':
                f = open("profile.txt", 'r')
                data = f.read()
                f.close()
                data = ast.literal_eval("{"+data+"}")
                if data[session["login"]][0] == "#b":
                    basicprofile = prob
                else:
                    basicprofile = data[session["login"]][0]
                hint = chats[name][0][2]
                background = chats[name][0][1]
                
                f = open("chatt.txt", 'r')
                chatt = f.read()
                f.close()
                chatt = ast.literal_eval("{"+chatt+"}")
                
                chating = chatt[name]
                c=int(len(chating)/3)

                pj = {}
                
                for io in range(c):
                    if chating[3*io] in pj:
                        pass
                    else:
                        
                        if data[chating[3*io]][0] == "#b":
                            pj[chating[3*io]] = prob
                        else:
                            pj[chating[3*io]] = data[chating[3*io]][0]
                    

                
                return render_template('chat.html',pj=pj,c=c,chating=chating,background=background,name=name,hint=hint,id=session["login"],profileimage=basicprofile)
            else:
                return "<script>alert('You do not have access permission.');location.href = '../home'</script>"
    else:
        return "<script>location.href = '../login'</script>"
    
